import './App.css';
import { useState } from "react";

export default function SweepNotes() {
  const [Lpfloor1, setLpfloor1] = useState('');
  const [Lpfloor2, setLpfloor2] = useState('');
  const [Lpfloor3, setLpfloor3] = useState('');
  const [Lpfloor4, setLpfloor4] = useState('');
  const [Lpfloor5, setLpfloor5] = useState('');
  const [Lpfloor6, setLpfloor6] = useState('');

  const [Wsfloor1, setWsfloor1] = useState('');
  const [Wsfloor2, setWsfloor2] = useState('');
  const [Wsfloor3, setWsfloor3] = useState('');
  const [Wsfloor4, setWsfloor4] = useState('');
  const [Wsfloor5, setWsfloor5] = useState('');
  const [Wsfloor6, setWsfloor6] = useState('');
  const [Wsbasement, setWsbasement] = useState('');

  const [LpCommonRoom, setLpCommonRoom] = useState('');
  const [LpLaundry, setLpLaundry] = useState('');
  const [WsStudyRoom, setWsStudyRoom] = useState('');
  const [WsLaundry, setWsLaundry] = useState('');

  const [LpNotes, setLpNotes] = useState('');
  const [WsNotes, setWsNotes] = useState('');

  const handleCopy = () => {
    const sweepNotes = `
      ${Lpfloor1 && `LP Floor 1: ${Lpfloor1}\n`}
      ${Lpfloor2 && `LP Floor 2: ${Lpfloor2} (Students in study room: ___, Students in kitchen: ___)\n`}
      ${Lpfloor3 && `LP Floor 3: ${Lpfloor3}\n`}
      ${Lpfloor4 && `LP Floor 4: ${Lpfloor4}\n`}
      ${Lpfloor5 && `LP Floor 5: ${Lpfloor5}\n`}
      ${Lpfloor6 && `LP Floor 6: ${Lpfloor6}\n`}
      ${LpCommonRoom && `LP Common Spaces: ${LpCommonRoom} students in Common Room, ${LpLaundry} students in Laundry\n`}
      ${LpNotes && `LP Additional Notes: ${LpNotes}\n`}
      ${Wsfloor1 && `WS Floor 1: ${Wsfloor1} (Students in common room: ___)\n`}
      ${Wsfloor2 && `WS Floor 2: ${Wsfloor2} (Students in common room: ___)\n`}
      ${Wsfloor3 && `WS Floor 3: ${Wsfloor3}\n`}
      ${Wsfloor4 && `WS Floor 4: ${Wsfloor4}\n`}
      ${Wsfloor5 && `WS Floor 5: ${Wsfloor5}\n`}
      ${Wsfloor6 && `WS Floor 6: ${Wsfloor6}\n`}
      ${WsStudyRoom && `WS Basement: ${WsStudyRoom} students in Study Room, ${WsLaundry} students in Laundry\n`}
      ${WsNotes && `WS Additional Notes: ${WsNotes}\n`}
    `;
    navigator.clipboard.writeText(sweepNotes.trim()).then(() => {
      alert("Sweep notes copied to clipboard!");
    });
  };

  return (
    <div className="sweep-notes">
      <div className="input-cards">
        <div className="card">
          <h1>Les Prince</h1>
          <label>Floor 1 </label>
          <input 
            type="text" 
            value={Lpfloor1} 
            onChange={(e) => setLpfloor1(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Floor 2 </label>
          <input 
            type="text" 
            value={Lpfloor2} 
            onChange={(e) => setLpfloor2(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Floor 3 </label>
          <input 
            type="text" 
            value={Lpfloor3} 
            onChange={(e) => setLpfloor3(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Floor 4 </label>
          <input 
            type="text" 
            value={Lpfloor4} 
            onChange={(e) => setLpfloor4(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Floor 5 </label>
          <input 
            type="text" 
            value={Lpfloor5} 
            onChange={(e) => setLpfloor5(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Floor 6 </label>
          <input 
            type="text" 
            value={Lpfloor6} 
            onChange={(e) => setLpfloor6(e.target.value)} 
            placeholder="Number of Students" 
          />

          <label>Common Room </label>
          <input 
            type="text" 
            value={LpCommonRoom} 
            onChange={(e) => setLpCommonRoom(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Laundry </label>
          <input 
            type="text" 
            value={LpLaundry} 
            onChange={(e) => setLpLaundry(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Additional Notes </label>
          <textarea 
            value={LpNotes} 
            onChange={(e) => setLpNotes(e.target.value)} 
            placeholder="Details about Noise Complaints, Incident Reports, Service Requests, etc." 
          />
        </div>

        <div className="card">
          <h1>WoodStock</h1>
          <label>Floor 1 </label>
          <input 
            type="text" 
            value={Wsfloor1} 
            onChange={(e) => setWsfloor1(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Floor 2 </label>
          <input 
            type="text" 
            value={Wsfloor2} 
            onChange={(e) => setWsfloor2(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Floor 3 </label>
          <input 
            type="text" 
            value={Wsfloor3} 
            onChange={(e) => setWsfloor3(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Floor 4 </label>
          <input 
            type="text" 
            value={Wsfloor4} 
            onChange={(e) => setWsfloor4(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Floor 5 </label>
          <input 
            type="text" 
            value={Wsfloor5} 
            onChange={(e) => setWsfloor5(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Floor 6 </label>
          <input 
            type="text" 
            value={Wsfloor6} 
            onChange={(e) => setWsfloor6(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Basement Study Room </label>
          <input 
            type="text" 
            value={WsStudyRoom} 
            onChange={(e) => setWsStudyRoom(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Basement Laundry </label>
          <input 
            type="text" 
            value={WsLaundry} 
            onChange={(e) => setWsLaundry(e.target.value)} 
            placeholder="Number of Students" 
          />
          <label>Additional Notes </label>
          <textarea 
            value={WsNotes} 
            onChange={(e) => setWsNotes(e.target.value)} 
            placeholder="Details about Noise Complaints, Incident Reports, Service Requests, etc." 
          />
        </div>
      </div>

      <div className="output-card">
        <button className="copy-button" onClick={handleCopy}>Copy Sweep Notes</button>
        <h1>Sweep Notes</h1>
        <p>Notes will generate </p>
        {Lpfloor1 && <p>LP Floor 1: {Lpfloor1}</p>}
        {Lpfloor2 && <p>LP Floor 2: {Lpfloor2} (Students in study room: ___, Students in kitchen: ___)</p>}
        {Lpfloor3 && <p>LP Floor 3: {Lpfloor3}</p>}
        {Lpfloor4 && <p>LP Floor 4: {Lpfloor4}</p>}
        {Lpfloor5 && <p>LP Floor 5: {Lpfloor5}</p>}
        {Lpfloor6 && <p>LP Floor 6: {Lpfloor6}</p>}
        {LpCommonRoom && <p>LP Common Spaces: {LpCommonRoom} students in Common Room, {LpLaundry} students in Laundry</p>}
        {LpNotes && <p>LP Additional Notes: {LpNotes}</p>}
        {Wsfloor1 && <p>WS Floor 1: {Wsfloor1} (Students in common room: ___)</p>}
        {Wsfloor2 && <p>WS Floor 2: {Wsfloor2} (Students in common room: ___)</p>}
        {Wsfloor3 && <p>WS Floor 3: {Wsfloor3}</p>}
        {Wsfloor4 && <p>WS Floor 4: {Wsfloor4}</p>}
        {Wsfloor5 && <p>WS Floor 5: {Wsfloor5}</p>}
        {Wsfloor6 && <p>WS Floor 6: {Wsfloor6}</p>}
        {WsStudyRoom && <p>WS Basement: {WsStudyRoom} students in Study Room, {WsLaundry} students in Laundry</p>}
        {WsNotes && <p>WS Additional Notes: {WsNotes}</p>}
      </div>
    </div>
  );
}
